import React from "react";

const BlogCard = () => {
  return (
    <div>
      <img
        src="https://isdi.in/blog/wp-content/uploads/2021/07/Interior-Material-Combinations.jpg"
        alt=""
        className="blogcardimg w-full object-cover"
      />
    </div>
  );
};

export default BlogCard;
